[{"location":"","page":"Home","title":"Home","text":"CurrentModule = BioAtomsCount","category":"page"},{"location":"#BioAtomsCount","page":"Home","title":"BioAtomsCount","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This is a fast and lightweight package that counts the number of atoms in a given BioSequence object. It was inspired by the Biocost.jl package.","category":"page"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"pkg> add BioAtomsCount","category":"page"},{"location":"#Usage","page":"Home","title":"Usage","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"The BioAtomsCount module exports a single function countatoms which takes a BioSequence object as input and returns a matrix of the count of atoms in the sequence. ","category":"page"},{"location":"","page":"Home","title":"Home","text":"Each column of the matrix corresponds to a different atom (C, H, N, O) for DNA and (C, H, N, O, S) for proteins and each row corresponds to a different residue in the sequence.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Here is an example of a DNA sequence:","category":"page"},{"location":"","page":"Home","title":"Home","text":"using BioSequences\n\nphi = dna\"\"\n\ncountatoms(phi)\n\n4×4 Matrix{Int64}:\n#   C     H     N     O    \n 6455  6455  6455     0  # A\n 4628  5785  3471  1157  # C\n 6270  6270  6270  1254  # G\n 8420  8420  3368  3368  # T","category":"page"},{"location":"","page":"Home","title":"Home","text":"Now an example of a protein sequence:","category":"page"},{"location":"","page":"Home","title":"Home","text":"lambdaprotein = aa\"MEVNKKQLADIFGASIRTIQNWQEQGMPVLRGGGKGNEVLYDSAAVIKWYAERDAEIENEKLRREVEELRQASEADLQPGTIEYERHRLTRAQADAQELKNARDSAEVVETAFCTFVLSRIAGEIASILDGLPLSVQRRFPELENRHVDFLKRDIIKAMNKAAALDELIPGLLSEYIEQSG*\"\n\ncountatoms(lambdaprotein)\n\n20×5 Matrix{Int64}:\n#  C    H   N   O  S\n  60  140  20  40  0  # Alanine (Ala)\n  90  210  60  30  0  # Arginine (Arg)\n  28   56  14  21  0  # Asparagine (Asn)\n  40   70  10  40  0  # Aspartic Acid (Asp)\n   3    7   1   2  1  # Cysteine (Cys)\n  50   90  10  40  0  # Glutamic Acid (Glu)\n 110  220  44  66  0  # Glutamine (Gln)\n  22   55  11  22  0  # Glycine (Gly)\n  12   18   6   4  0  # Histidine (His)\n  78  169  13  26  0  # Isoleucine (Ile)\n 108  234  18  36  0  # Leucine (Leu)\n  54  126  18  18  0  # Lysine (Lys)\n  15   33   3   6  3  # Methionine (Met)\n  45   55   5  10  0  # Phenylalanine (Phe)\n  25   45   5  10  0  # Proline (Pro)\n  27   63   9  27  0  # Serine (Ser)\n  20   45   5  15  0  # Threonine (Thr)\n  22   24   4   4  0  # Tryptophan (Trp)\n  36   44   4  12  0  # Tyrosine (Tyr)\n  50  110  10  20  0  # Valine (Val)","category":"page"},{"location":"#License","page":"Home","title":"License","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"MIT License","category":"page"}]
